import { Button, Header, Input } from '../../components';

import { GetCepContainer } from './style';

export const Home: React.FC = () => {
    return (
        <>
            <Header />

            <div>
                <h1>Home Page</h1>
                <GetCepContainer>
                    <Input />
                    <Button title='Buscar Cep'/>
                </GetCepContainer>
            </div>
        </>
    )
}
